function Quotes(){

        fetch('https://fakerapi.it/api/v1/persons?_quantity=20', {
                method: 'GET',
                // mode: "no-cors",
            }).then(
                 res => {
                    // let data = await res.json();
                    // return data;
                    res => res.json();
                }
            ).then(
                data => {
                    console.log(data);
                }
            ).catch(
                (reason) => {
                    console.log("Error: \n" + reason);
                }
            ).finally(
                () => {
                    console.log("this is just a final signal.");
                }
            );






    return <div>quotes</div>
}

